INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 7, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 7001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 7, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 7002, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 7, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 7003, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 10, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 10001, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 10, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 10002, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 10, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 10003, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106401, 10, "2030/12/17 14:59:59", 0, 2, 2104010, 1, "2015/12/17 15:00:00", 0.0, 0.0, "シェフィ", 10004, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 12, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 12001, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", -416.5, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 13, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 13001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 13, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 13002, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106401, 13, "2030/12/17 14:59:59", 0, 2, 2104010, 1, "2015/12/17 15:00:00", 0.0, 0.0, "シェフィ", 13003, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 13, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 13004, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 14, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 14001, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106401, 14, "2030/12/17 14:59:59", 0, 2, 2104010, 1, "2015/12/17 15:00:00", 0.0, 0.0, "シェフィ", 14002, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 14, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 14003, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 14, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 14004, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 15, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 15001, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", -470.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106401, 16, "2030/12/17 14:59:59", 0, 2, 2104010, 1, "2015/12/17 15:00:00", 0.0, 0.0, "シェフィ", 16001, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 16, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 16002, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 16, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 16003, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 16, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 16004, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 17, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 17002, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 25, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 17004, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 25, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 17005, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106401, 25, "2030/12/17 14:59:59", 0, 2, 2104010, 1, "2015/12/17 15:00:00", 0.0, 0.0, "シェフィ", 17006, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 25, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 17007, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 18, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "カリン", 18001, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 18, "2030/12/17 14:59:59", 0, 1, 0, 2, "2015/12/17 15:00:00", 0.0, 0.0, "カリン", 18002, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 19, "2030/12/17 14:59:59", 0, 1, 0, 3, "2015/12/17 15:00:00", 0.0, 0.0, "カリン", 19001, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", -470.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 19, "2030/12/17 14:59:59", 0, 1, 0, 4, "2015/12/17 15:00:00", 0.0, 0.0, "カリン", 19002, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", -470.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 20, "2030/12/17 14:59:59", 0, 1, 0, 5, "2015/12/17 15:00:00", 0.0, 0.0, "カリン", 20001, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", -470.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 20, "2030/12/17 14:59:59", 0, 1, 0, 6, "2015/12/17 15:00:00", 0.0, 0.0, "カリン", 20002, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", -470.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 21, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 21001, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 21, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 21002, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106401, 21, "2030/12/17 14:59:59", 0, 2, 2104010, 1, "2015/12/17 15:00:00", 0.0, 0.0, "シェフィ", 21003, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 21, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 21004, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 22, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "カリン", 22001, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", -430.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 22, "2030/12/17 14:59:59", 0, 1, 0, 2, "2015/12/17 15:00:00", 0.0, 0.0, "カリン", 22002, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", -430.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 23, "2030/12/17 14:59:59", 0, 1, 0, 3, "2015/12/17 15:00:00", 0.0, 0.0, "カリン", 23001, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", -430.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 23, "2030/12/17 14:59:59", 0, 1, 0, 4, "2015/12/17 15:00:00", 0.0, 0.0, "カリン", 23002, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", -430.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109001, 24, "2030/12/17 14:59:59", 10011, 1, 0, 1, "2019/01/31 12:00:00", 4.08, 8.0, "エリコ（バレンタイン）", 24001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", -385.0, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109001, 24, "2030/12/17 14:59:59", 10011, 1, 0, 2, "2019/01/31 12:00:00", 5.0, 8.0, "エリコ（バレンタイン）", 24002, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", -385.0, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109001, 24, "2030/12/17 14:59:59", 10011, 1, 0, 3, "2019/01/31 12:00:00", 10.11, 8.0, "エリコ（バレンタイン）", 24003, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", -385.0, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109001, 24, "2030/12/17 14:59:59", 10011, 1, 0, 4, "2019/01/31 12:00:00", 4.0, 8.0, "エリコ（バレンタイン）", 24004, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", -385.0, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109001, 24, "2030/12/17 14:59:59", 10011, 1, 0, 5, "2019/01/31 12:00:00", 6.0, 8.0, "エリコ（バレンタイン）", 24005, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", -385.0, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109002, 24, "2030/12/17 14:59:59", 10011, 1, 0, 6, "2019/01/31 12:00:00", 0.0, 0.0, "エリコ（バレンタイン）", 24006, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109002, 24, "2030/12/17 14:59:59", 10011, 1, 0, 7, "2019/01/31 12:00:00", 0.0, 0.0, "エリコ（バレンタイン）", 24007, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109002, 24, "2030/12/17 14:59:59", 10011, 1, 0, 8, "2019/01/31 12:00:00", 0.0, 0.0, "エリコ（バレンタイン）", 24008, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109002, 24, "2030/12/17 14:59:59", 10011, 1, 0, 9, "2019/01/31 12:00:00", 0.0, 0.0, "エリコ（バレンタイン）", 24009, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109002, 24, "2030/12/17 14:59:59", 10011, 1, 0, 10, "2019/01/31 12:00:00", 0.0, 0.0, "エリコ（バレンタイン）", 24010, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109101, 24, "2030/12/17 14:59:59", 10011, 1, 0, 1, "2019/01/31 12:00:00", 2.12, 8.0, "シズル（バレンタイン）", 24011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", -385.0, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109101, 24, "2030/12/17 14:59:59", 10011, 5, 0, 2, "2019/01/31 12:00:00", 4.19, 8.0, "シズル（バレンタイン）", 24012, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", -385.0, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109101, 24, "2030/12/17 14:59:59", 10011, 2, 0, 3, "2019/01/31 12:00:00", 2.3, 8.0, "シズル（バレンタイン）", 24013, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", -385.0, 4);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109102, 24, "2030/12/17 14:59:59", 10011, 1, 0, 4, "2019/01/31 12:00:00", 0.0, 0.0, "シズル（バレンタイン）", 24014, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109101, 24, "2030/12/17 14:59:59", 10011, 5, 0, 5, "2019/01/31 12:00:00", 5.23, 8.0, "シズル（バレンタイン）", 24015, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", -385.0, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109102, 24, "2030/12/17 14:59:59", 10011, 1, 0, 6, "2019/01/31 12:00:00", 0.0, 0.0, "シズル（バレンタイン）", 24016, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109101, 24, "2030/12/17 14:59:59", 10011, 1, 0, 7, "2019/01/31 12:00:00", 5.01, 8.0, "シズル（バレンタイン）", 24017, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", -385.0, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109102, 24, "2030/12/17 14:59:59", 10011, 1, 0, 8, "2019/01/31 12:00:00", 0.0, 0.0, "シズル（バレンタイン）", 24018, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109102, 24, "2030/12/17 14:59:59", 10011, 1, 0, 9, "2019/01/31 12:00:00", 0.0, 0.0, "シズル（バレンタイン）", 24019, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (109102, 24, "2030/12/17 14:59:59", 10011, 1, 0, 10, "2019/01/31 12:00:00", 0.0, 0.0, "シズル（バレンタイン）", 24020, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106401, 26, "2030/12/17 14:59:59", 0, 2, 2104010, 1, "2015/12/17 15:00:00", 0.0, 0.0, "シェフィ", 26001, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 26, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 26002, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 26, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 26003, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 26, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 26004, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106401, 27, "2030/12/17 14:59:59", 0, 2, 2104010, 1, "2015/12/17 15:00:00", 0.0, 0.0, "シェフィ", 27001, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 27, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 27002, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 27, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 27003, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 27, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 27004, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 28, "2030/12/17 14:59:59", 0, 1, 0, 1, "2019/09/24 15:00:00", 0.0, 0.0, "カリン", 28001, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 28, "2030/12/17 14:59:59", 0, 1, 0, 2, "2019/09/24 15:00:00", 0.0, 0.0, "カリン", 28002, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 29, "2030/12/17 14:59:59", 0, 1, 0, 3, "2019/09/24 15:00:00", 0.0, 0.0, "カリン", 29001, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 29, "2030/12/17 14:59:59", 0, 1, 0, 4, "2019/09/24 15:00:00", 0.0, 0.0, "カリン", 29002, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 30, "2030/12/17 14:59:59", 0, 1, 0, 5, "2019/09/24 15:00:00", 0.0, 0.0, "カリン", 30001, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 30, "2030/12/17 14:59:59", 0, 1, 0, 6, "2019/09/24 15:00:00", 0.0, 0.0, "カリン", 30002, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 31, "2030/12/17 14:59:59", 0, 1, 0, 7, "2019/10/31 12:00:00", 0.0, 0.0, "カリン", 31001, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 31, "2030/12/17 14:59:59", 0, 1, 0, 8, "2019/10/31 12:00:00", 0.0, 0.0, "カリン", 31002, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 32, "2020/01/04 4:59:59", 0, 1, 0, 1, "2019/12/20 5:00:00", 0.0, 0.0, "カリン", 32001, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 32, "2020/01/04 4:59:59", 0, 1, 0, 2, "2019/12/20 5:00:00", 0.0, 0.0, "カリン", 32002, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 33, "2020/01/04 4:59:59", 0, 1, 0, 3, "2019/12/20 5:00:00", 0.0, 0.0, "カリン", 33001, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 33, "2020/01/04 4:59:59", 0, 1, 0, 4, "2019/12/20 5:00:00", 0.0, 0.0, "カリン", 33002, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 34, "2020/01/10 11:59:59", 0, 1, 0, 5, "2020/01/04 5:00:00", 0.0, 0.0, "カリン", 34001, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 34, "2020/01/10 11:59:59", 0, 1, 0, 6, "2020/01/04 5:00:00", 0.0, 0.0, "カリン", 34002, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", -409.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 38, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 5.3, 0.0, "ペコリーヌ", 38001, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", -458.0, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 38, "2030/12/17 14:59:59", 0, 1, 0, 2, "2015/12/17 15:00:00", 6.5, 0.0, "ペコリーヌ", 38002, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", -458.0, 2);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 39, "2020/04/08 23:59:59", 0, 3, 0, 0, "2020/04/01", 0.0, 9999.0, "ペコリーヌ", 39005, "", 9999.0, 3);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (190801, 40, "2030/12/17 14:59:59", 0, 1, 0, 2, "2015/12/17 15:00:00", 0.0, 0.0, "カリン", 40001, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", -430.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106401, 41, "2030/12/17 14:59:59", 0, 1, 2104010, 1, "2015/12/17 15:00:00", 0.0, 0.0, "シェフィ", 41001, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 41, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 41002, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 41, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 41003, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 41, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 41004, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 42, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 42001, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", -416.5, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106401, 42, "2030/12/17 14:59:59", 0, 1, 2104010, 1, "2015/12/17 15:00:00", 0.0, 0.0, "シェフィ", 42002, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", -416.5, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 42, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 42003, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", -416.5, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 42, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 42004, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", -416.5, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105801, 43, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "ペコリーヌ", 43001, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (105901, 43, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "コッコロ", 43002, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (106001, 43, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "キャル", 43003, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", -363.0, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (123001, 44, "2030/12/17 14:59:59", 0, 1, 0, 1, "2015/12/17 15:00:00", 0.0, 0.0, "アメス", 43004, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", -416.5, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (123001, 44, "2030/12/17 14:59:59", 0, 1, 0, 2, "2015/12/17 15:00:00", 0.0, 0.0, "アメス", 43005, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", -416.5, 1);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES (123001, 45, "2030/12/17 14:59:59", 0, 1, 0, 3, "2015/12/17 15:00:00", 5.79, 0.0, "アメス", 43006, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", -416.5, 2);
